UPDATE PUB_SMC FROM $$STGDB.WI_WIPS_POS_SVC_DETAILS_PUB_SMC PUB_SMC, $$STGDB.WI_SOL_WITH_ZERO_SPLIT ZERO_SPLT SET DV_ALLOCATION_PCT = ZERO_SPLT.DV_ALLOCATION_PCT/CNT_REC WHERE PUB_SMC.TRANS_ID = ZERO_SPLT.TRANS_ID;
COLLECT STATISTICS COLUMN (TRANS_ID) ON $$STGDB.WI_SOL_WITH_ZERO_SPLIT;
CALL COLLECT_STATS_WRAP('$$STGDB','WI_WIPS_POS_SVC_DETAILS_PUB_SMC;','D');
